/* eslint-disable react/no-unescaped-entities */
/* eslint-disable no-extra-semi */
import React from 'react';
import '../main/main.css';
import gambar0 from "./component/main/las1.png";


function Main() {
    return (
        <>  
            <div className='w-100'>
              <div className='row'>
               <div className="col-lg-5">
                   <div className="mb-5" id='main-panel'>
                 <h1 className="display-4 mb-3">
                  Turn your ideas into a
                </h1>
                    
                    

                    <p className='lead'> Front's feature-rich designed demo pages help you create the best possible product.
                    </p>    
                </div>

                  <div className="d-grid d-sm-flex gap-3" id='btn-mainpanel'>
                    <a className="btn btn-primary btn-transition px-6" id="btn1" href="#">Get started</a>
                    <a className="btn btn-link" href="#">Learn more <i className="bi-chevron-right small ms-1"></i></a>
                  </div>
                </div>
              </div>


              <div className="col-lg-7 col-xl-6 d-none d-lg-block position-absolute top-0 end-0 pe-0">
                
              <svg xmlns="http://www.w3.org/2000/svg" x="0px" y="0px" viewBox="0 0 1137.5 979.2">
              <path fill="rgb(207, 207, 207)" d="M565.5,957.4c81.1-7.4,155.5-49.3,202.4-115.7C840,739.8,857,570,510.7,348.3C-35.5-1.5-4.2,340.3,2.7,389
              c0.7,4.7,1.2,9.5,1.7,14.2l29.3,321c14,154.2,150.6,267.8,304.9,253.8L565.5,957.4z"></path>

              <path id='gambar1' d="M1137.5,0H450.4l-278,279.7C22.4,430.6,24.3,675,176.8,823.5l0,0C316.9,960,537.7,968.7,688.2,843.6l449.3-373.4V0z"></path>
            
          </svg>         
        </div>
        </div>
        </>
    )
};

export default Main;
